import React, { useState } from "react";
import { useNavigate } from 'react-router-dom';

import axios from "axios";
import {
  Button,
  Card,
  CardHeader,
  CardBody,
  FormGroup,
  Form,
  Input,
  Row,
  Col,
  CardFooter,
} from "reactstrap";

import bgImage from "assets/img/bg5.jpg";

function ForgotPassword (props) {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [message, setMessage] = useState("");
  // const navigate = useNavigate();

  const handleForgotPassword = async () => {
  if (password !== confirmPassword) {
    setMessage("Passwords are Not Matched.");
    return;
  }

  try {
    console.log('Sending Forgot password request with:', { username, password });
    const response = await axios.post('http://localhost:5000/forgotpassword', {
      username: username,
      password: password,
    });

    if (response.status === 200) {
      setMessage("Password updated successfully.");
    } else {
      setMessage("An error occurred. Please try again.");
    }
  } catch (error) {
    setMessage(error.response.data.message);
  }
};


  return (
    <div className="content d-flex justify-content-center align-items-center" style={{ overflowX: "hidden", height: "100vh", backgroundImage: `url(${bgImage})`, backgroundSize: "cover", backgroundPosition: "center", backgroundRepeat: "no-repeat" }}>
      <Row>
        <Col md="6" className="text-center">
          <Card  style={{ width: "400px" }}>
            <CardHeader>
              <h5 >Welcome</h5>
            </CardHeader>
            <CardBody >
              <Form>
                <Row className="justify-content-center">
                  <Col className="pr-md-1" md="8">
                    <FormGroup >
                      <label>Username/ Email</label>
                      <Input className="mt-1"
                        placeholder="Username/ Email"
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}>
                      </Input>
                    </FormGroup>
                  </Col>
                </Row>
                <Row className="justify-content-center">
                <Col className="pr-md-1" md="8">
                    <FormGroup >
                      <label>Password</label>
                      <Input className="mt-1"
                        type="password"
                        placeholder="Password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}>
                      </Input>
                    </FormGroup>
                  </Col>
                </Row>
                <Row className="justify-content-center">
                <Col className="pr-md-1" md="8">
                    <FormGroup >
                      <label>Confirm Password</label>
                      <Input
                        className="mt-1"
                        type="password"
                        placeholder="Confirm Password"
                        value={confirmPassword}
                        onChange={(e) => setConfirmPassword(e.target.value)}>
                      </Input>
                    </FormGroup>
                  </Col>
                </Row>
              </Form>
              {message && <div>{message}</div>}
            </CardBody>
            <CardFooter >
              <Button type="submit" className="btn-fill" onClick={handleForgotPassword} color="primary" >
                Update Password
              </Button>
              <br />
              <label>
                Already have an account? <a href="login">Login</a>
              </label>
              <br />
              <label>Don't have an account? <a href="register">Sign Up</a> </label>
            </CardFooter>
          </Card>
        </Col>
      </Row>
    </div>
  );
}

export default ForgotPassword;
